    top:10%;
    overflow:hidden;
    font-family: Montserrat;
    width:100%
    height: 250vh;
    background-color: #e5e5e5;
}`;

const Left = styled.div`

  h1 {
    color:#939191;
    font-size: 2rem;
    font-weight: 600;
  }
  p {
    font-size: 1rem;
  }
`;

const Right = styled.div`
  display: -webkit-box;
  margin: 0;
  padding: 0;
  img {
    padding-right: 0;
    margin-right: -10px;
    right: 0;
  }
  h1 {
      color:#939191;
    font-size: 2rem;
    font-weight: 600;
  }
  p {
    position:relative;
    font-size: 1rem;
    left:25%;
  }

`;
