  text-align: left;
  justify-between: space-evenly;
  display: flex;
  align-items: center;
  max-width: 1100px;
  padding: 30px;
  margin-left: 40px;
  @media screen and (max-width:670){
    width:100%;
  }
`;

const Projects = () => {
  const fetchURL = "http://localhost/lister/Home";
  const getItems = () => fetch(fetchURL).then(res => res.json());
  const [items, setItems] = useState();

  useEffect(() => {
     getItems().then(data => setItems(data));
  }, []);
  return (

    <>

      <Container>

        <Heading>Projects and Skills</Heading>
        <Row>
          <Left id="top_left">{items.map(x => (<p>{x.project_description}</p>))}</Left>
